import React, { Component } from 'react';

export class Loot extends Component {
  render() {
    return (
      <div>
        <p className="loot">&#128176;</p>
        <h2>CALL ME IF YOU WIN !</h2><br />
      </div>
    );
  }
}

export default Loot;
